import React from "react";
import Box from "@material-ui/core/Box";
import logoOurVisit from "../icons/logoOurVisit.png";
import "../components.css";
import { height } from "@material-ui/system";
import SettingsIcon from "@material-ui/icons/Settings";
import HelpOutlineIcon from "@material-ui/icons/HelpOutline";

export default function TestNav() {
  return (
    <div style={{ width: "100%" }}>
      <div className="top-nav-stick">
        <div
          className="top-nav-child"
          style={{ width: "80%", paddingLeft: "20px" }}
        >
          <img className="lambent-sizing" src={logoOurVisit} alt="Logo" />
        </div>
        <div className="top-nav-child" style={{ width: "10%" }}>
          <SettingsIcon color="action" style={{ fontSize: "36px" }} />
        </div>
        <div className="top-nav-child" style={{ width: "10%" }}>
          <HelpOutlineIcon color="action" style={{ fontSize: "36px" }} />
        </div>
      </div>
    </div>
  );
}
